import  React from 'react';
import {Profile} from "./profile";
import user from "../user";

export const App = ()=>(
    <>
            <Profile
                name={user.name}
                tag={user.tag}
                location={user.location}
                avatar={user.avatar}
                // stats={user.stats}
            />
        }

    </>
);

export default App;
